private static long parseLong(Map<String, Object> entityInfo,
    String infoKey) {
  long result = 0;
  Object infoValue = entityInfo.get(infoKey);
  if (infoValue != null) {
    result = Long.parseLong(infoValue.toString());
  }
  return result;
}
